css:
a[target="_blank"],a[target="blank"],a[target="_blanck"],a[target="blanck"],a[target="new"],a[target="_new"]
{
	/*New Cursor*/
	cursor:url("data:image/cursor;base64,"),pointer !important;
}

a[onclick]
{
	/*Cursor JS OK*/
	cursor: url("data:image/cursor;base64,"),pointer !important;
}

a[href^="javascript"],a[href*=";"]
{
	/*Cursor JS NOK*/
	cursor:url("data:image/cursor;base64,"),pointer !important;
}

a[onclick][href="#"],a[onclick][href=""],a[onclick][href^="javascript"],a[onclick][href*=";"]
{
	/*Cursor JS NOK*/
	cursor:url("data:image/cursor;base64,"),pointer !important;
}
